var windowWidth = window.innerWidth;


// .advantage--swiper
$(".advantage--swiper-container").addClass('swiper-container');
$(".advantage--swiper-wrapper").addClass('swiper-wrapper');
$(".advantage--swiper-slide").addClass('swiper-slide');

var advantage = new Swiper(".advantage--swiper-container", {
    slidesPerView: 'auto',
    spaceBetween: 15,
    freeMode: {
        enabled: true,
        minimumVelocity: 0.2,
        momentum: false,
    },
    scrollbar: {
        el: '.advantage--swiper-container .swiper-scrollbar',
        hide: false,
        draggable: true,
    },
    breakpoints: {
        // when window width is >= 640px
        640: {
            slidesPerView: 3,
            spaceBetween: 30,
        }
    }
});


// certificate
var certificate = new Swiper(".certificate", {
    slidesPerView: 'auto',
    spaceBetween: 30,

    centeredSlides: false,
    initialSlide: 1,

    navigation: {
        nextEl: ".certificate .swiper-button-next",
        prevEl: ".certificate .swiper-button-prev",
    },

    breakpoints: {
        1020: {
            spaceBetween: 30,
            centeredSlides: false,
            initialSlide: 1,
        },
        700: {
            spaceBetween: 20,
            centeredSlides: true,
            initialSlide: 3,
        },
        100: {
            spaceBetween: 15,
            centeredSlides: true,
            initialSlide: 3,
        },
    },
});

// portfolio
var portfolio = new Swiper(".portfolio", {
    slidesPerView: 1,
    spaceBetween: 30,
    effect: "creative",
    creativeEffect: {
        prev: {
            shadow: true,
            translate: ["-120%", 0, -500],
        },
        next: {
            shadow: true,
            translate: ["120%", 0, -500],
        },
    },

    navigation: {
        nextEl: ".portfolio .swiper-button-next",
        prevEl: ".portfolio .swiper-button-prev",
    },
});


